import React, { FunctionComponent } from 'react'; // importing FunctionComponent
import './Tile.css';

type TileProps = {
    type: string,
}

export const Tile: FunctionComponent<TileProps> = ({ type }) =>
        <div className = {type.length<=1 ? "letter" : type} >
            <h1>{type.length<=1 ? type : ""}</h1>
        </div>

const el = <Tile type="W" />
